import React from 'react';

class User extends React.Component {
  state = { showUser: false };

  handleShowUser = () => this.setState({ showUser: !this.state.showUser });

  render() {
    let showUser;

    if (this.state.showUser) {
      showUser = (
        <div>
          <p>
            {this.props.email} - {this.props.accessType}
          </p>
          <button onClick={this.props.deleteUser}>Delete User</button>
        </div>
      );
    }

    return (
      <div>
        <p onClick={this.handleShowUser}>
          {this.props.fullName} {this.props.UserList}
        </p>
        {showUser}
        {/* {this.state.showUser && (
          <div>
            <p>
              {this.props.email} - {this.props.accessType}
            </p>
            <button onClick={this.props.deleteUser}>Delete User</button>
          </div>
        )} */}
      </div>
    );
  }
}

export default User;
